import './App.css';
import Read from './components/combos/read.js';
import Create from './components/combos/create.js';
import Update from './components/combos/update.js';
import { BrowserRouter as Router,Switch , Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>

      <div className='main'>
        <h2 className='mian-header'> Combos </h2>
        <Link to='/create'>
          <button>Crear usuario</button>
        </Link>

        <div>
          <Routes>
            <Route path="/create" Component={Create}></Route> 
          </Routes>
        </div>


        <div>
          <Routes>
            <Route path="/read" Component={Read}></Route> 
          </Routes>
        </div>



        <div>
          <Routes>
            <Route path="/upddte" Component={Update}></Route> 
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
